    false,nt"url": null,nt"notes": "Accident - (1975-current): This data file
    (NTAD 2015) contains information about crash characteristics and environmental conditions
    at the time of the crash. There is one record per crash. Please note: 425 records
    in this database were geocoded to latitude and logtitude of 0,0 due to lack of location
    information or errors in the reported locations.FARS data are made available to
    the public in Statistical Analysis System (SAS) data files as well as Database Files
    (DBF). Over the years changes have been made to the type of data collected and the
    way the data are presented in the SAS data files. Some data elements have been dropped
    and new ones added, coding of individual data elements has changed, and new SAS
    data files have been created. Coding changes and the years for which individual
    data items are available are shown in the u00e2u0080u009cData Element Definitions
    and Codesu00e2u0080u009d section of this document. The FARS Coding and Editing Manual
    contains a detailed description of each SAS data elements including coding instructions
    and attribute definitions. The Coding Manual is published for each year of data
    collection. Years 2001 to current are available at: http://www-nrd.nhtsa.dot.gov/Cats/listpublications.aspx?Id=J&ShowBy=DocType
    Note: In this manual the word vehicle means in-transport motor vehicle unless otherwise
